import axios from 'axios'
import React, { useEffect, useState } from 'react'

function Wishlist() {

  const [wishlist,setWishlist]=useState([])

  function loadWishlist()
  {
    axios.get('http://localhost:9090/wishlist/getAll').then(res=>{setWishlist(res.data)}).catch(err=>{console.log(err)})
  }

  useEffect(()=>
  {
    loadWishlist()
  },[])

  return (
    <div className='bg-dark text-light'>
      <div className='container'>
        <h1 className='text-center pt-3'>Wishn List Items</h1>
        <div>
          {
            wishlist.map(data=>(
              <div className='d-flex'>
                <h4>{data.bookName}</h4>
                <img src={data.bookImg} className/>
                <h5>{data.bookAuthor}</h5>
                
              </div>
            ))
          }
        </div>
      </div>
    </div>
  )
}

export default Wishlist
